import React, { useState } from 'react';
import axios from 'axios';
import './AuthModal.css';

const AuthModal = ({ isOpen, onClose }) => {
    const [view, setView] = useState('login'); // login, adminLogin, signUp
    const [name, setName] = useState('');
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');

    const handleLogin = () => {
        axios.post('http://localhost:5000/auth/login', { username, password })
            .then(response => {
                console.log('User logged in:', response.data);
                onClose();
            })
            .catch(error => {
                console.error('Error logging in:', error);
            });
    };

    const handleAdminLogin = () => {
        axios.post('http://localhost:5000/auth/admin-login', { username, password })
            .then(response => {
                console.log('Admin logged in:', response.data);
                onClose();
            })
            .catch(error => {
                console.error('Error logging in:', error);
            });
    };

    const handleSignUp = () => {
        if (password !== confirmPassword) {
            alert("Passwords do not match!");
            return;
        }

        axios.post('http://localhost:5000/auth/signup', { name, username, password })
            .then(response => {
                console.log('User signed up:', response.data);
                onClose();
            })
            .catch(error => {
                console.error('Error signing up:', error);
            });
    };

    if (!isOpen) {
        return null;
    }

    return (
        <div className="modal-overlay">
            <div className="modal">
                <button className="close-button" onClick={onClose}>X</button>
                <div className="modal-header">
                    <button onClick={() => setView('login')} className={view === 'login' ? 'active' : ''}>Login</button>
                    <button onClick={() => setView('adminLogin')} className={view === 'adminLogin' ? 'active' : ''}>Admin Login</button>
                    <button onClick={() => setView('signUp')} className={view === 'signUp' ? 'active' : ''}>Sign Up</button>
                </div>
                <div className="modal-content">
                    {view === 'login' && (
                        <div>
                            <h2>Login</h2>
                            <input type="text" placeholder="Username" value={username} onChange={(e) => setUsername(e.target.value)} />
                            <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
                            <button onClick={handleLogin}>Login</button>
                        </div>
                    )}
                    {view === 'adminLogin' && (
                        <div>
                            <h2>Admin Login</h2>
                            <input type="text" placeholder="Username" value={username} onChange={(e) => setUsername(e.target.value)} />
                            <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
                            <button onClick={handleAdminLogin}>Admin Login</button>
                        </div>
                    )}
                    {view === 'signUp' && (
                        <div>
                            <h2>Sign Up</h2>
                            <input type="text" placeholder="Name" value={name} onChange={(e) => setName(e.target.value)} />
                            <input type="text" placeholder="Username" value={username} onChange={(e) => setUsername(e.target.value)} />
                            <input type="password" placeholder="Password" value={password} onChange={(e) => setPassword(e.target.value)} />
                            <input type="password" placeholder="Confirm Password" value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} />
                            <button onClick={handleSignUp}>Sign Up</button>
                        </div>
                    )}
                </div>
            </div>
        </div>
    );
};

export default AuthModal;
